// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

contract AssetManager {
    // Asset
    struct Asset {
        string name;
        uint256 creationTime;
        address owner;
    }

    // imageIdAsset
    mapping(string => Asset) private assets;

    // 
    mapping(address => string[]) private userAssets;

    // 
    event AssetAdded(address indexed owner, string imageId, string name, uint256 creationTime);
    // 
    event AssetTransferred(address indexed from, address indexed to, string imageId);

    // 
    function addAsset(string memory _imageId, string memory _name) public {
        require(bytes(_imageId).length > 0, "Image ID cannot be empty");
        require(bytes(_name).length > 0, "Name cannot be empty");
        require(assets[_imageId].creationTime == 0, "Asset already exists");

        Asset memory newAsset = Asset({
            name: _name,
            creationTime: block.timestamp,
            owner: msg.sender
        });

        assets[_imageId] = newAsset;
        userAssets[msg.sender].push(_imageId);

        emit AssetAdded(msg.sender, _imageId, _name, block.timestamp);
    }

    // 
    function changeAssetOwner(string memory _imageId, address _oldOwner, address _newOwner) internal {
        require(_newOwner != address(0), "New owner cannot be zero address");
        require(assets[_imageId].owner == _oldOwner, "The old owner is not the owner of the asset");

        // 
        string[] storage ownedAssets = userAssets[_oldOwner];
        for (uint i = 0; i < ownedAssets.length; i++) {
            if (keccak256(bytes(ownedAssets[i])) == keccak256(bytes(_imageId))) {
                ownedAssets[i] = ownedAssets[ownedAssets.length - 1];
                ownedAssets.pop();
                break;
            }
        }

        // 
        userAssets[_newOwner].push(_imageId);

        // 
        assets[_imageId].owner = _newOwner;

        emit AssetTransferred(_oldOwner, _newOwner, _imageId);
    }

    // 
    function getAssets(address _user) public view returns (string[] memory) {
        return userAssets[_user];
    }

    // 
    function getUser(string memory _imageId) public view returns (address) {
        return assets[_imageId].owner;
    }

    // 
    function getAssetName(string memory _imageId) public view returns (string memory) {
        return assets[_imageId].name;
    }

    // 
    function getAssetCreationTime(string memory _imageId) public view returns (uint256) {
        return assets[_imageId].creationTime;
    }
}
